css:
.dependency-view {
  overflow-y: auto;
  background-color: white;
}
.dependency-view .link {
  fill: none;
  stroke: #666;
  stroke-width: 1.5px;
  opacity: 0.5;
  transition-property: opacity;
  transition-duration: .2s;
}
.dependency-view .link.incomming {
  stroke: green;
  opacity: 0.9;
}
.dependency-view .link.outgoing {
  stroke: red;
  opacity: 0.9;
}
.dependency-view .link.dimmed {
  opacity: 0.05;
}
.dependency-view .link.filtered-out {
  opacity: 0;
}
.dependency-view #licensing {
  fill: green;
}
.dependency-view circle {
  fill: #ccc;
  stroke: #333;
  stroke-width: 1.5px;
  transition-property: opacity,fill;
  transition-duration: .2s;
  opacity: 1;
}
.dependency-view circle.inonly {
  fill: green;
}
.dependency-view circle.outonly {
  fill: blue;
}
.dependency-view circle.circular {
  fill: red;
}
.dependency-view circle.hovering {
  opacity: 1;
  fill: #b94431;
}
.dependency-view circle.not-hovering {
  opacity: 0.05;
}
.dependency-view circle.filtered-out {
  opacity: 0;
}
.dependency-view text {
  font: 10px sans-serif;
  pointer-events: none;
  text-shadow: 0 1px 0 #ffffff, 1px 0 0 #ffffff, 0 -1px 0 #ffffff, -1px 0 0 #ffffff;
}
.dependency-view text.dimmed {
  opacity: 0.05;
}
.dependency-view text.filtered-out {
  opacity: 0;
}
.dependency-view g.dimmed {
  stroke-opacity: 0.05;
}
.dependency-view .graph .filter-section {
  position: absolute;
  top: 10px;
  right: 10px;
  width: 200px;
}
.dependency-view .graph .copy-message {
  position: absolute;
  top: 60px;
  right: 10px;
  width: 200px;
}
.dependency-view .graph .general-messages {
  position: absolute;
  top: 90px;
  right: 10px;
  width: 200px;
  bottom: 10px;
  padding: 5px;
  overflow: auto;
  background: rgba(200, 200, 200, 0.15);
}
.dependency-view .graph .general-messages h3 {
  margin-top: 10px;
  margin-bottom: 5px;
}
.dependency-view .control-zoom {
  position: absolute;
  top: 10px;
  left: 10px;
  background: rgba(0, 0, 0, 0.25);
  padding: 5px;
  border-radius: 7px;
  z-index: 100;
  display: inline-block;
  display: none;
}
.dependency-view .control-zoom a {
  background: rgba(255, 255, 255, 0.75);
  background-position: 50% 50%;
  background-repeat: no-repeat;
  display: block;
  width: 19px;
  height: 19px;
  border-radius: 4px;
}
.dependency-view .control-zoom a:last-child {
  margin: 0;
}
.dependency-view .control-zoom a:hover {
  background-color: white;
}
.dependency-view .control-zoom > .control-zoom-in {
  background-image: url(data:image/png;base64,);
  margin-bottom: 5px;
}
.dependency-view .control-zoom > .control-zoom-out {
  background-image: url(data:image/png;base64,);
  margin-bottom: 5px;
}
